import React, { useReducer } from 'react';
import Home from './Home';
import { MdAdd, MdOutlineSwapHoriz, MdClose } from "react-icons/md";

export default function ScreensLayout() {
    const [windows, windowsDispatch] = useReducer(windowsReducer, ['0-home', '0-home', '0-home', '0-home']);
    const [menu, menuDispatch] = useReducer(menuReducer, ['', '', '', ''])
    return (
        <>
            <MenuButtonCont position={{
                gridRowStart: 'a0',
                gridColumnStart: 'a0'
            }}>
                <MenuButton>
                    <MdClose />
                </MenuButton>
                <MenuButton>
                    <MdOutlineSwapHoriz />
                </MenuButton>
                <MenuButton onClick={() => {windowsDispatch({
                    type: 'add',
                    position: 0,
                    screen: 'home'
                })}}>
                    <MdAdd />
                </MenuButton>
            </MenuButtonCont>
            <MenuButtonCont position={{
                gridRowStart: 'a1',
                gridColumnEnd: 'a1',
                marginLeft: 'auto'
            }}>
                <MenuButton>
                    <MdClose />
                </MenuButton>
                <MenuButton>
                    <MdOutlineSwapHoriz />
                </MenuButton>
                <MenuButton>
                    <MdAdd />
                </MenuButton>
            </MenuButtonCont>
            <MenuButtonCont position={{
                gridRowEnd: 'a2',
                gridColumnStart: 'a2',
                marginTop: 'auto'
            }}>
                <MenuButton>
                    <MdClose />
                </MenuButton>
                <MenuButton>
                    <MdOutlineSwapHoriz />
                </MenuButton>
                <MenuButton>
                    <MdAdd />
                </MenuButton>
            </MenuButtonCont>
            <MenuButtonCont position={{
                gridRowEnd: 'a3',
                gridColumnEnd: 'a3',
                marginTop: 'auto',
                marginLeft: 'auto'
            }}>
                <MenuButton>
                    <MdClose />
                </MenuButton>
                <MenuButton>
                    <MdOutlineSwapHoriz />
                </MenuButton>
                <MenuButton>
                    <MdAdd />
                </MenuButton>
            </MenuButtonCont>

            <Screen position={{
                gridRowStart: 'a0',
                gridRowEnd: (windows[0] === windows[2] ? 'a2' : 'a0'),
                gridColumnStart: 'a0',
                gridColumnEnd: (windows[0] === windows[1] ? 'a1' : 'a0')
            }}>
                {windows[0].split('-')[1] === 'home' && <Home></Home>}
            </Screen>

            {windows[0] !== windows[1] && <Screen position={{
                gridRowStart: 'a1',
                gridRowEnd: (windows[1] === windows[3] ? 'a3' : 'a1'),
                gridColumnStart: 'a1',
                gridColumnEnd: 'a1'
            }}>
                {windows[1].split('-')[1] === 'home' && <Home></Home>}
            </Screen>}

            {windows[0] !== windows[2] && <Screen position={{
                gridRowStart: 'a2',
                gridRowEnd: 'a2',
                gridColumnStart: 'a2',
                gridColumnEnd: (windows[2] === windows[3] ? 'a3' : 'a2')
            }}>
                {windows[2].split('-')[1] === 'home' && <Home></Home>}
            </Screen>}

            {windows[1] !== windows[3] && windows[2] !== windows[3] && <Screen position={{
                gridRowStart: 'a3',
                gridRowEnd: 'a3',
                gridColumnStart: 'a3',
                gridColumnEnd: 'a3'
            }}>
                {windows[3].split('-')[1] === 'home' && <Home></Home>}
            </Screen>}
        </>
    );
}

function MenuButtonCont({position, children}) {
    return (
        <div style={{
            ...position,
            width: 'min-content',
            height: 'min-content',
            display: 'flex',
            flexDirection: 'column',
            backgroundColor: 'darkgray',
            zIndex: '2'
        }}>
            {children}
        </div>
    );
}

function MenuButton({onClick, children}) {
    return (
        <button onClick={onClick} style={{
            backgroundColor: 'transparent',
            border: 'none',
            margin: '0',
            padding: '0.3em'
        }}>
            {children}
        </button>
    );
}

function Screen({position, children}) {
  return (
    <div style={{
      ...position,
      border: '5px solid green',
      padding: '0.5em',
      overflow: 'scroll'
    }}>
      {children}
    </div>
  );
}

function windowsReducer(windows, action) {
    const time = new Date().getMilliseconds();
    document.getElementById("test").textContent = time;
    switch (action.type) {
      case 'add': {
        switch (action.position) {
          case 0: {
            if (windows[0] === windows[1] === windows[2] === windows[3]) {
              return windows.with(0, time + '-' + action.screen).with(2, time + '-' + action.screen);
            } else if (windows[2] === windows[0] || windows[1] === windows[0]) {
              return windows.with(0, time + '-' + action.screen);
            } else {
              throw Error('Should use `swap` instead of `add`');
            }
          }
          case 1: {
            if (windows[0] === windows[1] === windows[2] === windows[3]) {
              return windows.with(1, time + '-' + action.screen).with(3, time + '-' + action.screen);
            } else if (windows[0] === windows[1] || windows[3] === windows[1]) {
              return windows.with(1, time + '-' + action.screen);
            } else {
              throw Error('Should use `swap` instead of `add`');
            }
          }
          case 2: {
            if (windows[0] === windows[1] === windows[2] === windows[3]) {
              return windows.with(2, time + '-' + action.screen).with(3, time + '-' + action.screen);
            } else if (windows[0] === windows[2] || windows[3] === windows[2]) {
              return windows.with(2, time + '-' + action.screen);
            } else {
              throw Error('Should use `swap` instead of `add`');
            }
          }
          case 3: {
            if (windows[0] === windows[1] === windows[2] === windows[3]) {
              return windows.with(1, time + '-' + action.screen).with(3, time + '-' + action.screen);
            } else if (windows[1] === windows[3] || windows[2] === windows[3]) {
              return windows.with(3, time + '-' + action.screen);
            } else {
              throw Error('Should use `swap` instead of `add`');
            }
          }
          default: {
            throw Error('Unknown position for `add`: ' + action.position);
          }
        }
      }
      case 'remove': {
        //If all windows gone then go to home
        return windows.with(action.position, "");
      }
      case 'swap': {
        return windows.with(action.position, action.screen)
      }
      default: {
        throw Error('Unknown action: ' + action.type);
      }
    }
  }

  function menuReducer(menu, action) {

  }
